import './Tours.css';
import Tour from './Tour';


function Tours() {
    return (
        <div className='title'>
            <h1>Our Tours</h1>
            <div className='underline'></div>
            <Tour />
            <Tour/>
            <Tour/>
            <Tour/>
            <Tour/>

        </div>
    )
}

export default Tours;
